import React from "react";
import styles from "./"
const Pagination = ({ setOffset }) => {
  return (
    <div className="pagination">
      <button
        onClick={() => {
          setOffset((prevOffSet) => prevOffSet - 50);
        }}
      >
        {"<"}
      </button>
      <button
        onClick={() => {
          setOffset((prevOffSet) => prevOffSet + 50);
        }}
      >
        {">"}
      </button>
    </div>
  );
};

export default Pagination;
